<?php require_once("../includes/initialize.php");
date_default_timezone_set('Asia/Kathmandu');
$session_id = session_id(); 
$_SESSION['the_token']  = $session_id;
$api_url 		= 'https://www.gundri.com/beta/nabilapi/';
//$api_url 		= 'https://www.hotel.samratholidays.com/nabilapi/';
// $api_url 		= 'http://localhost/hotel/nabilapi/';
$checkin_date   =  isset($_REQUEST['hotel_check_in']) ? date('Y-m-d', strtotime(addslashes($_REQUEST['hotel_check_in']))) : date('Y-m-d');
$checkout_date  =  isset($_REQUEST['hotel_check_out']) ? date('Y-m-d', strtotime(addslashes($_REQUEST['hotel_check_out']))) : date('Y-m-d', strtotime('+1 day'));

if($checkin_date >= $checkout_date OR $checkin_date < date('Y-m-d')) {
	die('Please enter valid date');
}
$nofnight  		=  getDaysDiff($checkin_date, $checkout_date);
$hotel_code  	=  isset($_REQUEST['hotel_code']) ? addslashes($_REQUEST['hotel_code']) : '';
$user_id  	    =  isset($_REQUEST['user_id']) ? addslashes($_REQUEST['user_id']) : '0';?>
