																	if(isset($row['offers'])) {
																		$count_days_offers=0;
																		$newArr = array();
																		foreach($row['offers'] as $key=>$val) {
																			$exp_offers =  explode("/",$key);
																			$start_date =  isset($exp_offers[0]) ? $exp_offers[0] :''; 
																			$end_date   = isset($exp_offers[1]) ? $exp_offers[1] :''; 

																			$date1=date_create($start_date);
																			$date2=date_create($end_date);
																			$diff=date_diff($date1,$date2);
																			$nday = $diff->format("%a");
																			$newdate = array();
																			for($i=0; $i<=$nday; $i++) {
																				$newdate[] = date('Y-m-d', strtotime($start_date. ' + '.$i.' day'));
																			}
																			$newArr[] =  array_fill_keys($newdate, $val);

																		}//foreachofferclose
																		
																		$count    =  count(array_keys($newArr));													
																		for($i=0;$i<$count;$i++){ $offerArr = array_merge($offerArr,$newArr[$i]); }
																		

																		$date1=date_create($checkin_date);
																		$date2=date_create($checkout_date);
																		$diff=date_diff($date1,$date2);
																		$jday = $diff->format("%a");
																		$date_range = array();
																		for($i=0; $i<=$jday; $i++) {
																			$date_range[] = date('Y-m-d', strtotime($checkin_date. ' + '.$i.' day'));
																		}

																		// $date_range  =  daterange($checkin_date, $checkout_date);
																		$one_offer = $two_offer = $three_offer = 0;
																		if(!empty($offerArr)) {
																			$last_date = array_pop($date_range);
																			foreach($date_range as $dk=>$dv) {
																				if(array_key_exists($dv, $offerArr)) {
																					if($dv!=$last_date) {
																						$one_offer+= ($one_person-($one_person*($offerArr[$dv]/100)));
																						$two_offer+= ($two_person-($two_person*($offerArr[$dv]/100)));
																						$three_offer+= ($three_person-($three_person*($offerArr[$dv]/100)));
																					}
																				}
																				else {
																					$one_offer+= $one_person;
																					$two_offer+= $two_person;
																					$three_offer+= $three_person;
																				}
																			}
																		}

																		$newoffer[$room_id]= $offerArr;

																		$one_person  =  ceil($one_offer/($nofnight));
																		$two_person  =  ceil($two_offer/($nofnight));
																		$three_person  =  ceil($three_offer/($nofnight));
																	}
																	//offers  ?> 

