																			<div class="icon"><i class="fa fa-user-circle fa-lg" aria-hidden="true"></i> x 1</div>
																			<div class="tag">
																				<input type="hidden" class="one_person_price" name="price_list[<?php echo $room_id;?>][1]" value="<?php echo $one_person;?>">
