																				<span class="discount"><?php echo $currency.'&nbsp;'.$two_person;?></span>
																				<?php if(!empty($offerArr)) { if(!empty($offerArr[$checkin_date])) { ?><span class="money"><?php echo $currency.'&nbsp;'.$m_two_person;?></span><?php } } ?>
